import './Footer.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faLinkedin } from '@fortawesome/free-brands-svg-icons'

const Footer = () => {
    return (
        <div class="footer">
            <p>Todos los derechos reservados &copy; 2023</p>
            <a href="https://www.linkedin.com/in/alan-luna-304655214/" target="_blank" rel="noopener noreferrer"><i class="fa-brands fa-linkedin"></i></a>
            <a href="https://github.com/AlanLuna-00" target="_blank" rel="noopener noreferrer" class="github"><FontAwesomeIcon icon={faLinkedIn} /></a>
        </div>
    )
}

export default Footer
